column8:
★プーマのジャケット！<br>
<br>
●軽量ながらも暖かい中綿仕様で、スポーツから通勤通学などタウンユースとしてお使い頂けます！<br>
●胸のキャットロゴ以外に、左袖にはシリコンプリントを使用しスポーティーな印象のワッペン付き。<br>
●左内側にポケット付き。<br>
●袖口、裾ともにパイピングが施され、体の熱を逃がさず冷たい外気の侵入を防ぎます。<br>
●ベーシックなデザインでシーンを選ばないジャケット！<br>
<br>
■素材 ポリエステル100％<br>
■企画製造販売元 プーマジャパン株式会社<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。

<BR>
